import React,{Component} from 'react';
import '../pages/HomePage/homePage.less';

class Header extends Component{
  constructor(props){
    super(props);
    this.state={};
  }
  
  render(){
    return(
      <React.Fragment>
        <div className="header">
          <div className="header-container">
              <ul>
                <li>中国大陆</li>
                <li>请登录</li>
                <li>手机逛淘宝</li>
              </ul>
              <ul>
                <li>我的淘宝</li>
                <li>购物车</li>
                <li>收藏夹</li>
                <li>商品分类</li>
                <li>千牛卖家中心</li>
                <li>联系客服</li>
                <li>网站导航</li>
              </ul>
          </div>
        </div>
      </React.Fragment>
    )
  }
}

export default Header;
